Description:
je mets en vente ma bmw serie 3 e92. elle ete immatricule tunisienne en janvier dernier (220) apres avoir passe 5 and en regime rs. elle a ete importee de belgique en mars 2015. elle ete mise en circulation depuis octobre 2010.
jusqu'a date elle a roule 224 000 km.
principale caracteristique :
-10 chevaux fiscaux essence;
-boite vitesse automatique;
-regulateur de vitesse;
-jante alu type m;
-peneus run flat bridgestone montes en 2020.
principaux defauts:
comme vous pouvez le voir dans les images la voiture n'indique aucun defaut. toutefois, il est a prendre les defaillances suivantes pour etat parfait.
-les balais des essuis glaces sont defectueuses;
-le systeme d'injection beugue lorsque la voiture est froide;
-les pare huile soupape sont defectueuses;
-pont de propulsion siffle.
je demande 59 000 tnd. legerement negociable. 
la voiture est visible a cite el ghazela sur rdv.

je vends ma voiture volkswagen polo 6 , 
annee 2008;
4 cv et 3 cylindre;
kilometrage  233 m km;
fermeture centrale;
moteur essence propre;
double cle disponible;
prix 17000 dt
tel 55615183
